function array_2_csv($array) {
	$csv = array();
	foreach ($array as $item=>$val) {
		if (is_array($val)) {
			$csv[] = array_2_csv($val);
			$csv[] = "\n";
		} else {
			$csv[] = $val;
		}
	}
	return implode(';', $csv);
}
